import React, { Component } from "react";
import "../styles/timeline.css";

class TimelineDescriptionRowCard extends Component {
  render() {
    const { cardClass, title, description, moreInfo } =
      this.props.timelineDescriptionRowCard;
    return (
      <div className={cardClass}>
        <div className="timeline-description-learn">
          <h2>{title}</h2>
          <h2>{moreInfo}</h2>
        </div>
        <p>{description}</p>
      </div>
    );
  }
}

export default TimelineDescriptionRowCard;
